import React from "react";
import {GoogleMap,Marker, withScriptjs, withGoogleMap} from "react-google-maps";

import styled from "styled-components";

const map = (props)=>{
 
return(<GoogleMap defaultZoom={10} defaultCenter={{lat: 45.502651, lng:-73.555252}}>
  {props.isMarkerShown && <Marker position={{lat: 45.502651, lng:-73.555252}}>/</Marker>
}</GoogleMap>);
}


const Contact = () => {

// const WrappedMap = withScriptjs(withGoogleMap(map));
 

// API:  AIzaSyARbNwTVD7DMSu4sn54xXldxmIXRUIZJ4o
  return (
    <>
      <Wrapper>
        <h1>Contact

        </h1>
        <MapDiv>

          {/* <WrappedMap
            GoogleMapUrl={"https://maps.googleapis.com/maps/api/js?key=AIzaSyARbNwTVD7DMSu4sn54xXldxmIXRUIZJ4o&callback=initMap"}
            loadingElement={<div style={{height:"100%"}}/>}
            constainerElement={<div style={{height:"100%"}}/>}
            mapElement={<div style={{height:"100%"}}/>}
            
            /> */}
        </MapDiv>
      
      </Wrapper>
    </>
  );
};

export default Contact;

const Wrapper = styled.div`
  font-size: 55px;
  color: red;
`;

const MapDiv = styled.div``;
